import React from "react";
import Signup from "../components/Signup";


import './header.css';


import {
    Link,
  } from "react-router-dom";

const Header = () => {
    return (
        <header>
            <nav>
            <Link to='/' className="lookfor">
                {/* <div className="logo"></div> */}



                <svg width="286" height="174" viewBox="0 0 286 174" fill="none" xmlns="http://www.w3.org/2000/svg">
<path d="M8 66.5L59.5 65.5C68.8333 44.8333 94.5 8 141 8C195.557 8 222 54 224.5 66.5" stroke="#FF475D" stroke-width="15" stroke-linecap="round" stroke-linejoin="round" class="svg-elem-1"></path>
<path d="M278.5 108L227 109C217.667 129.667 192 166.5 145.5 166.5C90.9427 166.5 64.5 120.5 62 108" stroke="#FF475D" stroke-width="15" stroke-linecap="round" stroke-linejoin="round" class="svg-elem-2"></path>
<circle cx="144" cy="89" r="41" fill="#1C17F2" class="svg-elem-3"></circle>
</svg>

            </Link>
                <div className="links">
                <Link to='/' className="lookfor">EXPLORE</Link>
                <Link to='/login' className="signup">LOGIN / SIGNUP</Link>

                </div>
            </nav>
        </header>
    )
}
export default Header;
